fn print_grid(grid: [[char; SIZE]; SIZE]) {
    for (_i, row) in grid.iter().enumerate() {
        for (_j, c) in row.iter().enumerate() {
            print!("{}", c);
        }
        println!();
    }
}

fn calc1() -> i32 {
    let mut grid = [['.'; SIZE]; SIZE];
    for line in INPUT.lines() {
        let mut split = line.split(" -> ");
        let mut prev = split
            .next()
            .unwrap()
            .split(",")
            .map(|s| s.parse::<i32>().unwrap())
            .collect::<Vec<i32>>();
        println!();
        for point in split {
            let point = point
                .split(",")
                .map(|s| s.parse::<i32>().unwrap())
                .collect::<Vec<i32>>();
            println!("{:?} {:?}", prev, point);
            let mut p1 = (prev[0] - OFFSET, prev[1]);
            let p2 = (point[0] - OFFSET, point[1]);
            let dir = ((point[0] - prev[0]).signum(), (point[1] - prev[1]).signum());
            while p1 != p2 {
                grid[p1.1 as usize][p1.0 as usize] = '#';
                p1.0 += dir.0;
                p1.1 += dir.1;
            }
            grid[p1.1 as usize][p1.0 as usize] = '#';
            prev = point;
        }
    }
    print_grid(grid);

    let mut sand_count = 0;
    loop {
        let mut sand = SOURCE.clone();
        loop {
            if grid[(sand.1 + 1) as usize][sand.0 as usize] == '.' {
                sand.1 += 1;
                // println!("D {} {}", sand.0, sand.1);
            } else if grid[(sand.1 + 1) as usize][(sand.0 - 1) as usize] == '.' {
                sand.1 += 1;
                sand.0 -= 1;
                // println!("L {} {}", sand.0, sand.1);
            } else if grid[(sand.1 + 1) as usize][(sand.0 + 1) as usize] == '.' {
                sand.1 += 1;
                sand.0 += 1;
                // println!("R {} {}", sand.0, sand.1);
            } else {
                sand_count += 1;
                grid[sand.1 as usize][sand.0 as usize] = 'o';
                // println!("S {} {}", sand.0, sand.1);
                break;
            }

            if sand.1 >= SIZE as i32 - 1 {
                println!();
                print_grid(grid);
                return sand_count;
            }
        }
    }
}

fn calc2() -> i32 {
    let mut grid = vec![['.'; SIZE]; SIZE];
    let mut highest = 0;
    for line in INPUT.lines() {
        let mut split = line.split(" -> ");
        let mut prev = split
            .next()
            .unwrap()
            .split(",")
            .map(|s| s.parse::<i32>().unwrap())
            .collect::<Vec<i32>>();
        // println!();
        for point in split {
            let point = point
                .split(",")
                .map(|s| s.parse::<i32>().unwrap())
                .collect::<Vec<i32>>();
            // println!("{:?} {:?}", prev, point);
            let mut p1 = (prev[0] - OFFSET, prev[1]);
            let p2 = (point[0] - OFFSET, point[1]);
            let dir = ((point[0] - prev[0]).signum(), (point[1] - prev[1]).signum());
            while p1 != p2 {
                grid[p1.1 as usize][p1.0 as usize] = '#';
                p1.0 += dir.0;
                p1.1 += dir.1;
            }
            grid[p1.1 as usize][p1.0 as usize] = '#';
            prev = point;
            highest = if p1.1 > highest { p1.1 } else { highest };
        }
    }
    // print_grid(grid);

    let mut sand_count = 0;
    loop {
        let mut sand = SOURCE.clone();
        if grid[sand.1 as usize][sand.0 as usize] == 'o' {
            // println!();
            // print_grid(grid);
            break;
        }
        loop {
            if grid[(sand.1 + 1) as usize][sand.0 as usize] == '.' {
                sand.1 += 1;
                // println!("D {} {}", sand.0, sand.1);
            } else if grid[(sand.1 + 1) as usize][(sand.0 - 1) as usize] == '.' {
                sand.1 += 1;
                sand.0 -= 1;
                // println!("L {} {}", sand.0, sand.1);
            } else if grid[(sand.1 + 1) as usize][(sand.0 + 1) as usize] == '.' {
                sand.1 += 1;
                sand.0 += 1;
                // println!("R {} {}", sand.0, sand.1);
            } else {
                sand_count += 1;
                grid[sand.1 as usize][sand.0 as usize] = 'o';
                // println!("S {} {}", sand.0, sand.1);
                break;
            }

            if sand.1 > highest {
                sand_count += 1;
                grid[sand.1 as usize][sand.0 as usize] = 'o';
                break;
            }
        }
    }
    return sand_count;
}

pub fn calc() {
    println!("{}\n{}", 0, calc2());
}

